window.bookSummaryJSON = "<p><b><i>Rescued by the billionaire lumberjack....</i></b></p> <p>Lost.</p> <p>Alone.</p> <p>Freezing on the side of a desolate mountain in a massive snowstorm.</p> <p>Until a rugged man with an ax saves me.</p> <p>Waking in his warm, comfortable bed leaves more than one question.</p> <p>How did I get here?</p> <p>Where are my clothes?</p> <p>And who is this handsome recluse with striking dark eyes and a grumpy demeanor?</p> <p>The answers only bring more mysteries.</p> <p>He doesn’t want me here.</p> <p>Doesn’t want his secrets exposed.</p> <p>I don’t want him to know mine, either.</p> <p>But there’s only so long we can deny this sizzling attraction.</p> <p>Only so long until I learn the truth about my billionaire lumberjack and our pasts come back to haunt us.</p> <p><b><i>Grab this steamy stand-alone about a billionaire in hiding, the photographer who stumbles upon him, and what happens when they’re trapped together during a major snow storm with building attraction and dark secrets!</i></b></p>"; 
